import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import React from "react";
import Wallet from "./Wallet";

function MyWallets() {
  return (
    <>
      <Wallet />
      <Link as={Button} to="/wallet/create" variant="primary">
        Generate new wallet
      </Link>
    </>
  );
}

export default MyWallets;
